import Video from './Video'
import Timer from './Timer'
import 'bootstrap/dist/css/bootstrap.css'



const App = () => {

    const url='https://firebasestorage.googleapis.com/v0/b/saludyejercicio-8966d.appspot.com/o/fitnes.mp4?alt=media&token=83e7c600-5031-48f4-9687-5444a8d00a5f';
    return (
        <div class="container">
            <div class="row">
                <div class="col">
                <Video nombre="https://firebasestorage.googleapis.com/v0/b/saludyejercicio-8966d.appspot.com/o/fitnes.mp4?alt=media&token=83e7c600-5031-48f4-9687-5444a8d00a5f"/>
                </div>
                <div class="col">
                    <Timer/>
                </div>
            </div>
        </div>
    )
}
export default App;
